void loadPeople(RenderResource* obj)
{
    if(obj->mImage == NULL)
    {
        obj->mImage = malloc(PEOPLE_WIDTH*PEOPLE_HEIGHT*sizeof(uint16_t));
    }
    else return;

    for(uint16_t i = 0; i < PEOPLE_WIDTH*PEOPLE_HEIGHT; i++)
    {
        obj->mImage[i] = people[i];
    }
    return;
}

